import React from "react";
import Container from "@material-ui/core/Container";
import { Row, Col, Card, Button } from "react-bootstrap";
import "./About.css";
import MyPic from "../files/es.png";
import { Github, Linkedin } from "react-bootstrap-icons";
import Cv from "../files/cv.png";

export default function About() {
  return (
    <div className="aboutComponent">
      <Container className="aboutContainer">
        <Row>
          <Col>
            <Card style={{ width: "18rem" }}>
              <Card.Img variant="top" src={MyPic} />
              <Card.Body>
                <Card.Title>Erlens Gadzans</Card.Title>
                <Card.Link
                  href={
                    "https://strive.school/certificate/607731999566ba00173d7dbe"
                  }
                  target="_blank"
                >
                  Fullstack MERN Grad student
                </Card.Link>
                <Card.Text></Card.Text>
                <h3>
                  <Github />
                  <Linkedin />
                  CV
                </h3>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
}
